import {Outlet} from 'react-router-dom';

import Subnavigation from '../layouts/subnavigation'
import SubnavItem from '../layouts/subnavitem'

import styled from 'styled-components'
import '../styles/theme.css'

import NextJSLogo from '../assets/logo-nextjs.svg'
import DefaultLogo from '../assets/logo-default.svg'

function Operations() {
  return (
    <StyledContainer>
      <Subnavigation title='Insights'>
        <SubnavGroup>
          <SubnavItem to='app'>App</SubnavItem>
        </SubnavGroup>
        <SubnavGroup>
          <SubnavItem to='all'>Frontend</SubnavItem>
        </SubnavGroup>
      </Subnavigation>
      <Outlet/>
    </StyledContainer>
  )
}

const StyledContainer = styled('div')`
  display: grid;
  grid-template-columns: 200px auto;
`;

const SubnavGroup = styled('div')`
  align-content: flex-end;

  &:not(:last-child) {
    margin-bottom: var(--space-lg);
  }
`;

export default Operations;
